import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import IssuesPage from './pages/issue/issuePage';

function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route path="/" element={<IssuesPage />}> </Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
